query admin ( $adminID:ID! ) {
	admin ( adminID:$adminID ) {
		id
		firstName
		lastName
		email
		creationDate
		passwordNeverExpires
		mfaEnabled
		adminType
		managedRoles {
			roleAdminRole: role {
				id
				name
				description
				isPredefined
			}
			allowedEntitiesAdminRole: allowedEntities {
				id
				name
				typeEntity: type
			}
			allowedAccounts
		}

		resellerRoles {
			roleAdminRole: role {
				id
				name
				description
				isPredefined
			}
			allowedEntitiesAdminRole: allowedEntities {
				id
				name
				typeEntity: type
			}
			allowedAccounts
		}

	}	
}
